import React from "react";
import Python from "../images/python.jpeg";
import C from "../images/c++.png";
import Htm from "../images/html.png";  
import Css from "../images/css.png";
import Bootstrap from "../images/bootstrap.png";
import Js from "../images/js.png";
import Rea from "../images/react.png";
import Tailwind from "../images/tailwind.png";

const main = () => {
  return (
    <div className="w-[100vw] h-400 bg-white ">
      <div className="flex justify-center">
        <h1 className="text-4xl py-8 font-bold">SKILLS</h1>
      </div>

      <div className="md:flex-row md:flex flex-col  ">
        <div className="bg-green-400 md:w-1/3 h-60 m-10 border-2 rounded-xl py-6 uppercase font-bold  ">
          <p className="text-2xl text-center ">programming languages</p>
          <div className="py-8 flex justify-around">
            <img className="w-20 rounded-3xl" src={Python} alt="" />
            <img className="w-20 rounded-3xl" src={C} alt="" />
          </div>
        </div>
        <div className="bg-green-400 md:w-1/3 h-60  m-10  border-2 rounded-xl py-6 uppercase font-bold">
          <p className="text-2xl text-center">Front-End</p>
          <div className="py-8 flex justify-around">
          <img className="w-20 rounded-3xl" src={Htm} alt="" />
          <img className="w-20 rounded-3xl" src={Css} alt="" />
          <img className="w-20 rounded-3xl" src={Js} alt="" />
          <img className="w-20 rounded-3xl" src={Rea} alt="" />
          <img className="w-20 rounded-3xl" src={Bootstrap} alt="" />

          </div>
        </div>
        <div className="bg-green-400 md:w-1/3  h-60 m-10 border-2 rounded-xl p-8 uppercase font-bold ">
          <p className="text-2xl text-center"> back-end</p>
        </div>
      </div>
    </div>
  );
};

export default main;
